import React, { Component } from 'react';
import '../App.css'

class Home extends Component {
    render() {
        return (
            <div className="container" style={{padding: '20px', borderWidth: 2, borderColor: 'red'}}>
                <div className="App-header">
                    <p>tugas big data analytics</p>
                </div>
            </div>
        );
    }
}

export default Home
